import React, { useState } from 'react';
import styled from 'styled-components';

import Login from '../Login/Login';
import Signup from '../Signup/Signup';

const Links = styled.div`
	display: flex;
	font-family: 'Montserrat', sans-serif;
`;

function HeaderLinks() {
	const [showLogin, setShowLogin] = useState(false);
	const [showSignup, setShowSignup] = useState(false);

	return (
		<Links>
			<p>
				<button onClick={() => setShowLogin(true)} className='header-btn'>
					{' '}
					Log In{' '}
				</button>{' '}
				|{' '}
				<button onClick={() => setShowSignup(true)} className='header-btn'>
					{' '}
					Sign Up{' '}
				</button>
			</p>
			<Login open={showLogin} close={() => setShowLogin(false)} />
			<Signup open={showSignup} close={() => setShowSignup(false)} />
		</Links>
	);
}

export default HeaderLinks;
